objetoCompra:
- Revestimento de anteparas existentes, em fórmicas cinza ou similar;
- Recuperação de móveis existentes;
- Confecção teto em madeirame naval, revestido em fórmica branco brilho;
- Recuperação de bancos. Revestir em fórmica, refazer baú existente, estruturar e aplicar madeiramento lateral;
- Recuperação de mesas medindo, em fórmica sólido a definir;
- Confecção de porta de correr medindo com acabamento em fórmica sólida ou similar. Arredondar cantos vivos;
